import { Button, Card } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import { v4 as uuidv4 } from 'uuid';

//background-image: linear-gradient(to right bottom, #051937, #004d7a, #008793, #00bf72, #a8eb12);
const Header = () => {
  const roomId = uuidv4();
  return (
    <Card sx={{marginTop: 4, background: "gray"}}>
        <Link to={"/"}>
            <Button sx={{color:"white"}} variant="text">Home</Button>
        </Link>
        <Link style={{textDecoration:"none"}} to={"/chats"}>
            <Button sx={{color:"white"}} variant="text">Chats</Button>
        </Link>
        <Link to={`/room/${roomId}`}>
            <Button sx={{color:"white"}} variant="text">Rooms</Button>
        </Link>
    </Card>
  )
}

export default Header
